import React from 'react';
import './EndPage.css';

function EndPage() {
  const handleClose = () => {
    window.close(); // Close the current window/tab
  };

  return (
    <div className="end-page">
      <div className="end-page-content">
        <h1>Thank You!</h1>
        <p>Your responses have been successfully recorded.</p>
        <p>Thank you for participating in our study about AI-assisted fact-checking and trust assessment.</p>
        <p>Your contribution will help us better understand how people interact with AI systems in verifying information.</p>
        <button onClick={handleClose} className="close-button">
          Close Page
        </button>
      </div>
    </div>
  );
}

export default EndPage;
